import React from 'react';

const Show = props => (

    <div className="weather__info">

      { 
        props.type && <p className="weather__key"> Job Type: 
        <span className="weather__value"> { props.type }</span>
        </p>
      }

      { 
        props.url && <p className="weather__key"> URL: 
        <span className="weather__value"> { props.url }</span>
        </p> 
      }
      { 
        props.created_at && <p className="weather__key"> Created At: 
        <span className="weather__value"> { props.created_at }</span>
        </p> 
      }
      { 
        props.company && <p className="weather__key"> Company Name: 
        <span className="weather__value"> { props.company }</span>
        </p> 
      }
      { 
        props.company_url && <p className="weather__key"> Company URL: 
        <span className="weather__value"> { props.company_url }</span>
        </p> 
      }
      { 
        props.location && <p className="weather__key"> Job Location: 
        <span className="weather__value"> { props.location }</span>
        </p> 
      }
      { 
        props.job_title && <p className="weather__key"> Job Title: 
        <span className="weather__value"> { props.job_title }</span>
        </p> 
      }
      { 
        props.description && <p className="weather__key"> Job Description: 
        <span className="weather__value"> { props.description }</span>
        </p> 
      }
      { 
        props.company_logo && <p className="weather__key"> Company Logo: 
        <span className="weather__value"> { props.company_logo }</span>
        </p> 
      }
      { props.how_to_apply && <p className="weather__key"> How to apply: 
        <span className="weather__value"> { props.how_to_apply }</span>
        </p> 
        }
      { props.error && <p>
        <span> { props.error }</span>
        </p> 
      }

    </div>
);


export default Show;
